import Vue from 'vue';
import VueRouter from 'vue-router';
import Home from '../views/Home.vue';

Vue.use(VueRouter);

const routes = [
    {
        path: '/',
        name: 'home',
        component: Home
    },
    {
        path: '/about',
        name: 'about',
        component: () => import('../views/About.vue')
    },
    {
        path: '/grid',
        name: 'grid',
        component: () => import('../views/Grid.vue')
    }

]

const router = new VueRouter({
    mode: 'history',
    Base: process.env.BASE_URL,
    routes
})
